import React from 'react';
import { ImageBackground, Image, View, Text, Button, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';

//Styling
import { StyledView } from '../styles/wrapper';
import { LogoDiv } from '../styles/wrapper';
import { BttnDiv } from '../styles/wrapper';
import PressableButton from '../styles/buttons';


const WelcomeScreen = () => {
  const navigation = useNavigation();

  return (
    <StyledView>
      <LogoDiv>
        <View
          
        />
        <BttnDiv>
          <PressableButton
            onPress={() => navigation.navigate('Login')}
            title='Login'
            bgColor='blue'
          />
          <PressableButton
            onPress={() => navigation.navigate('Register')}
            title='Register'
            bgColor='red'
          />
        
        </BttnDiv>
      </LogoDiv>
        
      
    </StyledView>
  );
};

export default WelcomeScreen;
